import React from "react";
import '../CSS/Nav1.css'
import logo from '../Images/logo-crop.png'

const Nav1 = () => {
    return (
        <>
            <nav>
                <div className="navigation">
                    <div className="left_nav">
                        <img src={logo} className="logo_img" />
                    </div>
                    <div className="right_nav"></div>
                </div>
            </nav>
        </>
    )
}
export default Nav1;
